import groovy.json.JsonSlurper
import java.text.DateFormat;
import java.text.SimpleDateFormat;
import java.util.Calendar;
def lectureTimeSlot = context.expand( '${Excel Source#scheduleTimeSlot}' )
if (lectureTimeSlot=="Use Groovy Script")
{
def UTCDate = new java.text.SimpleDateFormat("yyyy-MM-dd")
Date dNow = new Date(System.currentTimeMillis()+((2.toInteger())*24*60*60*1000))
long millis = dNow.getTime();
def response = context.expand( '${getAvailabletimeSlots#Response#$.ResponseData}' );
def list = new JsonSlurper().parseText( response )
def objectSize = list.size();

def ScheduleTimeslot;
def timeSlot;

for (int i=2; i<=objectSize ; )
{
	ScheduleTimeslot = response.split(",")[i].split(":")[0].replaceAll('\"','');
	if (ScheduleTimeslot >=millis.toString())
	{
		timeSlot = ScheduleTimeslot;
		break;
	}
	i=i+2;
}
//def milliseconds = context.expand( '${Property#Timeslot}')
//testRunner.testCase.getTestStepByName("Property").setPropertyValue("ScheduleDate", timeSlot)
//def scheduleDate = context.expand( '${Property#scheduleDate}' )
long yourmilliseconds = timeSlot.toLong()
def  sdf = new java.text.SimpleDateFormat("yyyy-MM-dd HH:mm:ss:SSS'Z'",Locale.US);
def  calendar = new GregorianCalendar(TimeZone.getTimeZone("US/Eastern"));
calendar.setTimeInMillis(yourmilliseconds);
def dateis = sdf.format(calendar.getTime());
def newdate = new Date().parse("yyyy-MM-dd HH:mm:ss:SSS'Z'", dateis) 
def dateTimeFormat = "yyyy-MM-dd'T'HH:mm:ss.SSS'Z'"  
def timeZone = TimeZone.getTimeZone('UTC')
def dateTimeFormatter = new java.text.SimpleDateFormat(dateTimeFormat)
dateTimeFormatter.setTimeZone(timeZone)
def scheduleTimeslot1= dateTimeFormatter.format(newdate)
testRunner.testCase.getTestStepByName("Property").setPropertyValue("ScheduleDate", scheduleTimeslot1)
}

else
{
	testRunner.testCase.getTestStepByName("Property").setPropertyValue("ScheduleDate",lectureTimeSlot)
}

def response = context.expand( '${CancelLecture#Response#$.ResponseStatus}' )
def cancelLecture = context.expand( '${Excel Source#cancelLecture}' )

if(cancelLecture=="No")
{
	def status = "Created groupSession did not get cancelled"
	testRunner.testCase.getTestStepByName("Property").setPropertyValue("CancelLectureStatus", status)
}

if(cancelLecture=="Yes")
{
	testRunner.testCase.getTestStepByName("Property").setPropertyValue("CancelLectureStatus", response)
}

