if(CancelLectureInput=="No")
{

if ((GetCoachProfile=="OK") && (getEvents=="OK") && (getPrograms=="OK") && (getProgramSesionType=="OK") && (getSesionTypes=='OK')&& (getAvailabletimeSlots=="OK")&& (CreateLecture=="OK"))
{

		def res = "Passed"
		return res.toString()
	}
else
{
	def res="Failed"
	return res.toString()
}}

else
{
	if ((GetCoachProfile=="OK") && (getEvents=="OK") && (getPrograms=="OK") && (getProgramSesionType=="OK") && (getSesionTypes=='OK')&& (getAvailabletimeSlots=="OK")&& (CreateLecture=="OK")&& (CancelLecture=="OK"))
{

		def res = "Passed"
